    }
    resize(){
        this.setState({style:responsive_mock.mockblock.aptitude(10,15)})
    }
    render(){
        return <div style={this.state.style}>
            <Mocktest_block img={img_reasoning} topic={'Reasoning'} str={"Reasoning"}/>
        </div>
    }
}
